    false,nt"url": null,nt"notes": "In August of 1962, nine streams were visited
    in Prince William Sound. The purpose of this trip was to find out if any of these
    streams was suitable for improvement of existing spawning areas by removing fine
    materials from the streambed, creating artificial spawning channels, or installing
    fishways at barrier falls and opening up unused portions of the stream to spawning
    salmon. Evaluations and recommendations for these streams are included in this report.",nt"license_title":
